import React from 'react';
import { View, Image, Text, Alert } from 'react-native';
import styled from '@emotion/native';
import { InitialProps } from '@base/types';
import SigninRedirectButton from '../components/SigninRedirectButton';

export default function Initial({ route, navigation }: InitialProps){
    return (
        <InitialContainer>
            <LogoImage 
                source={{
                    uri: 'https://reactnative.dev/img/tiny_logo.png',
                }}
            />
            <Text>
                {"자신이 누구인지 선택해주세요."}
            </Text>
            <SigninRedirectButton 
                title="저는 고객입니다"
                handlePress={() => Alert.alert(
                    "알림",
                    "서비스 준비 중 입니다."
                )}
            />
            <SigninRedirectButton 
                title="저는 사장입니다."
                handlePress={() => {
                    navigation.navigate('Signin', {
                        signinType: "store",
                        title: "사장님 로그인",
                    });
                }}
            />
        </InitialContainer>
    )
}

const InitialContainer = styled.View`
    padding: 0 15%;
`

const LogoImage = styled.Image`
    width: 100px;
    height:100px;
    margin: 10% auto;
`;
